import java.util.List;/* * @author:Saawan * @created:[10/20/2020],Tuesday * Time:12:12 PM */public class Musician extends Human {    private String musicSchool;    private String genre;    private List<String>song;    public Musician(String name, int age, String musicSchool, String genre, List<String> song) {        super(name, age);        this.musicSchool = musicSchool;        this.genre = genre;        this.song = song;    }    public String getMusicSchool() {        return musicSchool;    }    public void setMusicSchool(String musicSchool) {        this.musicSchool = musicSchool;    }    public String getGenre() {        return genre;    }    public void setGenre(String genre) {        this.genre = genre;    }    public List<String> getSong() {        return song;    }    public void setSong(List<String> song) {        this.song = song;    }    @Override    public int getTimeToLive() {        return (LIFESPAN-getAge())/2;    }}